import { useAuthStore } from '@kaizen/auth-client';
import { useNavigate } from 'react-router-dom';
import { paths } from '../routes';
import { SidebarButton } from './sidebar-link';
import { BankNotesIcon, LogoutIcon, TodosIcon } from '@kaizen/ui';

export const Sidebar = () => {
  const navigate = useNavigate();
  const authStore = useAuthStore();

  const onLogoutClick = () => {
    authStore.logout();
    navigate(paths.home);
  };

  return (
    <div className="fixed h-full">
      <div className="bg-primary-700 flex h-full w-64 flex-col items-center justify-between p-4 text-neutral-600">
        <div className="flex w-full flex-col gap-y-4">
          <div className="border-primary-500 flex items-center gap-x-3 border-b pb-4">
            <div className="h-16 w-16">
              <img
                src="data:image/png;base64,"
                alt="Avatar"
                className="rounded-full"
              />
            </div>
            <h6 className="text-sm font-medium text-neutral-50">Noah Korner</h6>
          </div>

          <div className="w-full">
            <p className="mb-2 text-xs text-neutral-300">Dashboards</p>
            <SidebarButton
              icon={<BankNotesIcon />}
              href={paths.finance}
              label="Finances"
            />
            <SidebarButton
              icon={<TodosIcon />}
              href={paths.todos}
              label="Todos"
            />
          </div>
        </div>
        <div className="w-full">
          <p className="mb-2 text-xs text-neutral-300">Account</p>
          <SidebarButton
            icon={<LogoutIcon />}
            onClick={onLogoutClick}
            label="Logout"
          />
        </div>
      </div>
    </div>
  );
};
